  false,\n\t\"url\": null,\n\t\"notes\": \"The NSF Public Access Repository is a beta
  site that contains an initial collection of journal publications and the final accepted
  version of the peer-reviewed manuscript or the version of record. To do this, NSF
  draws upon services provided by the publisher community including the Clearinghouse
  of Open Research for the United States, CrossRef, and International Standard Serial
  Number. When clicking on a Digital Object Identifier number, you will be taken to
  an external site maintained by the publisher. Some full text articles may not be
  available without a charge during the embargo, or administrative interval. Some
  links on this page may take you to non-federal websites. Their policies may differ
  from this website.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
